import React from 'react'
import styled from 'styled-components'
import NewChoreForm from '../components/NewChoreForm'

function Settings(){
    const SettingsWrapper = styled.div`
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    width: 100%;
    height: 100%;
    `
    return (
        <SettingsWrapper>
            <NewChoreForm />
        </SettingsWrapper>
    )
}

export default Settings
